 \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1501","type":"CustomJS"},{"attributes":{"data":{},"selected":{"id":"1110"},"selection_policy":{"id":"1109"}},"id":"1092","type":"ColumnDataSource"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"glyph_width":0,"group":null,"items":[{"id":"1381"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"1380","type":"Legend"},{"attributes":{"format":"0,0.[00]%"},"id":"1090","type":"NumeralTickFormatter"},{"attributes":{"coordinates":null,"data_source":{"id":"1035"},"glyph":{"id":"1364"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1366"},"nonselection_glyph":{"id":"1365"},"view":{"id":"1368"}},"id":"1367","type":"GlyphRenderer"},{"attributes":{"axis_label":"Equity","coordinates":null,"formatter":{"id":"1090"},"group":null,"major_label_policy":{"id":"110
